import React from 'react';
import background from '../../img/howmakeorder.png';
import styles from './styles/order.module.scss';

const HowMakeOrder = () => {
    return (
        <div className={styles.block}>
            <img className={styles.background} src={background} alt="" />
            <div className="wrapper">
                <h2 className={styles.ttl}>Как сделать заказ</h2>
                <div className={styles.steps}>
                    <div className={styles.step}>
                        <h2 className={styles.stepTtl}>1 шаг</h2>
                        <h2 className={styles.stepDescription}>Выберите какие цветы или подарки вы хотите купить</h2>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default HowMakeOrder;
